import Layout1 from "../../layouts/layout1";
import 'jquery';
import "../../scss/index.scss";
import "antd/dist/antd.css";
import { Component } from "react";

class ProductPage extends Component {

    state = {
        Comp : null
    }

    renderComp = () => {
        this.state.Comp ? null : this.setState({Comp: import("../../components/IndexPage/Carousel")}) 
    }

    render(){
        const {Comp} = this.state;
        return (
            <Layout1>
                {this.state.Comp ? <Comp/> : null}
                <button onClick={() => this.renderComp()}>render component</button>
            </Layout1>
        )
    }

}

export default ProductPage;
